import Grid from "@mui/material/Grid2";
import styles from "./scss/Login.scss";
import CustomTextField from "../../shared/custom-text-field/CustomTextField";
import { handleLogin } from "./hooks/handleLogin";
import BlackButton from "../../shared/button/BlackButton";
import { Typography } from "@mui/material";
export default function Login() {
  return (
    <Grid container className={styles.pageContainer} id="page-container">
      <Grid
        container
        id="login-card"
        sx={{
          borderRadius: "5px",
          boxShadow: "0 0 5px 1px #e6e6e6",
          paddingBottom: "80px",
          maxWidth: "600px",
          justifyContent: "center",
          maxHeight: "500px",
          flexGrow: 0,
        }}
      >
        <Grid
          container
          width={"80%"}
          sx={{
            justifyContent: "center",
            paddingTop: "40px",
            paddingLeft: "40px",
            paddingRight: "40px",
            rowGap: "3vh",
          }}
        >
          <Grid container width={"80%"}>
            <Typography variant={"h4"}>Welcome back</Typography>
          </Grid>
          <Grid container width={"100%"} justifyContent={"center"}>
            <CustomTextField sx={{ width: "80%" }} label={"Username"} />
          </Grid>
          <Grid container width={"100%"} justifyContent={"center"}>
            <CustomTextField sx={{ width: "80%" }} label={"Password"} />
          </Grid>
          <Grid container width={"100%"} justifyContent={"center"}>
            <BlackButton
              sx={{ width: "80%" }}
              onClick={() => handleLogin("a", "a")}
            >
              Login
            </BlackButton>
          </Grid>
        </Grid>
      </Grid>
      {/* add filler grid item to take up remaining space so login form does not get stretched */}
      <Grid container sx={{ flexGrow: 1 }} />
    </Grid>
  );
}
